resourceMetrics:
  - resource: {}
    scopeMetrics:
      - metrics:
          - name: attr_extract_encounter_count
            sum:
              aggregationTemporality: 2
              dataPoints:
                - asInt: "1"
                  attributes:
                    - key: data_type
                      value:
                        stringValue: traces
                    - key: environment
                      value:
                        stringValue: testing
                    - key: name
                      value:
                        stringValue: deployment.environment
                    - key: scope
                      value:
                        stringValue: resource
